import axios from 'axios';
// axios is library  to call the library 
const API_URL= 'http://localhost:8000';

const uploadFile  =(data)=>{
    try{
   axios.post(`${API_URL}/upload`, data)
    }catch(error){
      console.error('Error while calling the api ',error.message)
    }
}
